Today in Lisbon, President @vonderleyen had her first meeting with the Portuguese Presidency of the EU.

From the smooth roll-out of vaccination in the EU to having our recovery plan, #NextGenerationEU, up and running, we share common priorities.

@2021PortugalEU #EU2021PT https://t.co/1CHuSIdeef

Looking to 2021, our #NextGenerationEU recovery plan will help us turn the #coronavirus challenge into an opportunity by:
🔹 cutting emissions;
🔹 boosting competitiveness;
🔹 reducing energy poverty;
🔹 creating jobs;
🔹 improving quality of life.
